import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <hr />
      <p>Developed by <strong>Debopriyo Choudhury</strong></p>
      <p>Email: <a href="mailto:sridebopriyo@gmail.com"></a></p>
      <p>LinkedIn: <a href="https://www.linkedin.com/in/debopriyo-choudhury-077043275/" target="_blank" rel="noopener noreferrer">https://www.linkedin.com/in/debopriyo-choudhury-077043275/</a></p>
      <p>Location: Kolkata, India | Passionate MERN Stack Developer</p>
    </footer>
  );
};

export default Footer;
